import React from 'react';
import logo from '../assets/img/logorustaco.png';
import '../assets/styles.css';

const Navbar = () => (
  <nav className="navbar">
    <div className="navbar-logo">
      <img src={logo} alt="Rustaco Logo" height={40} />
      <span className="navbar-title">Rustaco Eventos</span>
    </div>
    <div className="navbar-links">
      <a href="/">Inicio</a>
      <a href="/events">Eventos</a>
      <a href="/about">Nosotros</a>
      <a href="/contact">Contacto</a>
    </div>
  </nav>
);

const Header = () => (
  <header className="header">
    <h1>Próximos Eventos</h1>
    <p>Descubre los próximos torneos y actividades de la comunidad Rustaco</p>
  </header>
);

const Footer = () => (
  <footer className="footer">
    &copy; {new Date().getFullYear()} Rustaco Eventos &mdash; Inspirado en Rust. Todos los derechos reservados.
  </footer>
);

const EventCard = ({ title, date, description }) => (
  <div className="event-card">
    <h3>{title}</h3>
    <p className="event-date">{date}</p>
    <p>{description}</p>
  </div>
);

const eventsData = [
  {
    id: 1,
    title: 'Rust Tournament 2023',
    date: '15 de noviembre, 2023',
    description: '¡Compite por la gloria y premios en el torneo anual de Rustaco!'
  },
  {
    id: 2,
    title: 'Rust Community Meetup',
    date: '1 de diciembre, 2023',
    description: 'Encuentro de entusiastas para compartir estrategias y experiencias.'
  },
  {
    id: 3,
    title: 'Rust Game Development Workshop',
    date: '10 de enero, 2024',
    description: 'Aprende a desarrollar mods y juegos en Rust con expertos de la industria.'
  }
];

const Events = () => (
  <>
    <Navbar />
    <Header />
    <main>
      <h2>Eventos Programados</h2>
      <div className="event-list">
        {eventsData.map(event => (
          <EventCard key={event.id} {...event} />
        ))}
      </div>
    </main>
    <Footer />
  </>
);

export default Events;
